import React from 'react';

function navegador() {
  return (
    <nav className="navbar navbar-dark">
        <ul>
          <li><a href="#" id="href">Tienda</a></li>
          <li><a href="#" id="href">Registrate</a></li>
          <li><a href="#" id="href">Iniciar sesion</a></li>
        </ul>
     </nav>
  );
}
export default navegador;
